1. Here's a Python program that prints out the first 100 prime numbers:
```
n = 100 # maximum number of primes to find

# function to check if a number is prime
def is_prime(num):
    for i in range(2, num):
        if num % i == 0:
            return False
    return True

# loop through numbers up to n and print primes
for i in range(2, n + 1):
    if is_prime(i):
        print(i)
